(NULL, 'JD for SAP ABAP Consultant', NULL, 'Exciting Opportunity: SAP ABAP Consultant Position Available', '', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\">\r\n<html>\r\n<head>\r\n	<title></title>\r\n	\r\n</head>\r\n<body class=\"scayt-enabled\" data-gr-ext-installed=\"\" data-new-gr-c-s-check-loaded=\"14.1173.0\">\r\n<div>\r\n<center>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"borderGrey\" width=\"600px\">\r\n	<tbody>\r\n		<tr style=\"height:50px;\">\r\n			<td colspan=\"6\" style=\"border-top: 1px solid #ddd; font-family: Helvetica,Verdana,sans-serif\">Dear&nbsp;$leads-firstname$\r\n			<p style=\"margin-bottom: 0px; margin-left: 40px; margin-top: 0px;\"><span class=\"ui-provider a b c d e f g h i j k l m n o p q r s t u v w x y z ab ac ae af ag ah ai aj ak\" dir=\"ltr\"></span><br />\r\n			We are looking for a Consultant for the following role:<br />\r\n			<br />\r\n			<strong>Role</strong>: SAP ABAP Consultant<br />\r\n			<strong>Experience</strong>: 7 -10 Years<br />\r\n			<strong>Work</strong> <strong>Location</strong>: Remote<br />\r\n			<strong>Shift</strong>: 2nd Shift<br />\r\n			<strong>Availability</strong>: Immediate<br />\r\n			<br />\r\n			<strong>Job Description:</strong> Responsible for understanding requirements, building and deploying solutions &amp; and maintaining the same in the SAP ECC environment. The consultant needs to gather requirements, analyze, estimate, and document the solutions as well. Extensive experience in SAP ABAP (Core ABAP, Forms, Oops, ALE, IDOC, OOPS, Enhancements) Extensive experience in ODATA. Extensive experience in Developing custom Fiori apps using the SAPUI5 application.<br />\r\n			<br />\r\n			<strong>Other details: </strong>A Little overlap with the US Team is required<br />\r\n			<br />\r\n			If you are interested send your CV to sourcing@unicalsystems.com or you can reach to 888-697-8888 or respond to this message.<br />\r\n			&nbsp;</p>\r\n\r