(NULL, 'TechStorm Asp .Net Contract JD', NULL, 'Job Description for ASP.NET Developer Contract with US Client', '', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\">\r\n<html>\r\n<head>\r\n	<title></title>\r\n	\r\n</head>\r\n<body class=\"scayt-enabled\" data-gr-ext-installed=\"\" data-new-gr-c-s-check-loaded=\"14.1182.0\">\r\n<div>\r\n<center>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"borderGrey\" width=\"600px\">\r\n	<tbody>\r\n		<tr style=\"height:50px;\">\r\n			<td colspan=\"6\" style=\"border-top: 1px solid #ddd; font-family: Helvetica,Verdana,sans-serif\">Hello $leads-firstname$,<br />\r\n			<br />\r\n			Here is the Job Description for the ASP .Net Developer Contract role with one of our US Clients.&nbsp;&nbsp;Client prefer the resource to work in EST hours&nbsp; 4 AM-Noon Shift or Noon&ndash;8 PM EST (1:30 PM IST to 9:30 PM or 9:30 PM IST to 5:30 AM)<br />\r\n			<br />\r\n			This position involves overseeing security remediations for our web applications that utilize ASP and .NET-based systems. Responsibilities include identifying, analyzing, and implementing solutions to address security vulnerabilities, while also maintaining and enhancing the functionality and performance of our applications. Additional duties include developing security remediation measures within our platform to ensure its security, as well as implementing other functionalities to support business needs.<br />\r\n			<br />\r\n			<strong>Key Responsibilities:</strong>\r\n			<ul>\r\n				<li>Perform code reviews and security assessments to identify potential security vulnerabilities in our ASP and .NET applications.</li>\r\n				<li>Develop and implement secure coding practices, following industry standards and best practices (e.g., OWASP, SANS Top 25).</li>\r\n				<li>Collaborate with cross-functional teams, including security analysts and subject matter experts, to understand and prioritize security risks and remediation efforts.</li>\r\n				<li>Design and implement secure authentication and authorization mechanisms, data encryption, input validation, and other security controls.</li>\r\n				<li>Contribute to the development and maintenance of secure APIs and web services.</li>\r\n				<li>Participate in the testing and deployment of security patches and updates, ensuring compatibility and minimizing disruptions.</li>\r\n				<li>Stay up-to-date with the latest security threats, vulnerabilities, and mitigation techniques specific to ASP and .NET frameworks.</li>\r\n				<li>Provide guidance and mentorship to junior developers on secure coding practices and security-related issues.</li>\r\n				<li>Document security procedures, guidelines, and technical solutions for future reference and knowledge sharing.</li>\r\n				<li>Qualifications:</li>\r\n				<li>Bachelor&#39;s degree in Computer Science, Information Technology, or a related field, or equivalent development experience.</li>\r\n				<li>5+ years of experience in developing and maintaining ASP and .NET web applications.</li>\r\n				<li>Strong understanding of web application security principles, including authentication, authorization, input validation, and encryption.</li>\r\n				<li>Experience with secure coding practices and industry standards (e.g., OWASP, SANS Top 25).</li>\r\n				<li>Proficiency in VBScript, C#, ASP Classic (MVC, Web Forms), SQL and .NET Framework/Core.</li>\r\n				<li>Experience with SQL Server and database security best practices.</li>\r\n				<li>Familiarity with web services, REST APIs, and security protocols (e.g., OAuth, JWT).</li>\r\n				<li>Knowledge of Kendo UI or similar UI frameworks is a plus.</li>\r\n				<li>Knowledge of GITHub / BitBucket or similar tools is a plus.</li>\r\n				<li>Strong problem-solving and analytical skills, with the ability to identify and resolve complex security issues.</li>\r\n				<li>Excellent communication and collaboration skills, with the ability to work effectively with cross-functional teams.</li>\r\n				<li>Strong attention to detail and commitment to delivering high-quality, secure code.</li>\r\n			</ul>\r\n			<br />\r\n			In this role, you will play a vital part in ensuring the security and integrity of our web applications and .NET systems. You will work closely with cross-functional teams to identify and remediate security vulnerabilities, while contributing to the development and maintenance of secure and reliable applications.&nbsp; This position will be reporting to the Director of Correspondent Technology.<br />\r\n			<br />\r\n			Thanks,<br />\r\n			Sourcing Team - Unical Systems</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"6\" style=\"font-family: Helvetica,Verdana,sans-serif;font-size: 11px;color: #666666;\">\r\n			<table border=\"0\" cellpadding=\"4\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td colspan=\"2\" id=\"social\" valign=\"middle\">\r\n						<center>\r\n						<div>&nbsp;<a href=\"https://www.linkedin.com/company/unicalsystems/\" target=\"_blank\"> follow on LinkedIn</a> | <a href=\"https://www.facebook.com/unicalsystems\" target=\"_blank\">follow on Facebook</a></div>\r\n						</center>\r\n						</td>\r\n					</tr>\r\n					<!--copy right data-->\r\n					<tr>\r\n						<td valign=\"top\" width=\"350px\">\r\n						<center>\r\n						<div><em>Copyright &copy; 2024 <a href=\"www.unicalsystems.com\" target=\"_blank\">www.unicalsystems.com</a>, All rights reserved.</em></div>\r\n						</center>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</center>\r\n</div>\r\n</body>\r\n<grammarly-desktop-integration data-grammarly-shadow-root=\"true\"></grammarly-desktop-integration></html>\r\n', 0, 25, 0, 'Leads'),
(NULL, 'Jd_for_Power_BI_6_8_years', NULL, 'Job Description for Power BI Developer', '', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\">\r\n<html>\r\n<head>\r\n	<title></title>\r\n	\r\n</head>\r\n<body class=\"scayt-enabled\" data-gr-ext-installed=\"\" data-new-gr-c-s-check-loaded=\"14.1184.0\">\r\n<div>\r\n<center>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"borderGrey\" width=\"600px\">\r\n	<tbody>\r\n		<tr style=\"height:50px;\">\r\n			<td colspan=\"6\" style=\"border-top: 1px solid #ddd; font-family: Helvetica,Verdana,sans-serif\"><span style=\"font-family: Helvetica, Verdana, sans-serif;\">Hello $leads-firstname$,</span><br style=\"font-family: Helvetica, Verdana, sans-serif;\" />\r\n			<br style=\"font-family: Helvetica, Verdana, sans-serif;\" />\r\n			<span style=\"font-family: Helvetica, Verdana, sans-serif;\">Here is the Job Description for the Power BI Developer Contract role with one of our Clients.<br />\r\n			&nbsp;</span><br />\r\n			Our Client seeks an experienced Power BI Developer to join our dynamic team. The ideal candidate will have 6-8 years of experience in developing critical dashboards for finance and inventory management. This role requires strong expertise in Power BI, a deep understanding of SAP 4Hana, and proficiency in integrating data from SAP to Excel and then to Power BI dashboards. The candidate should also have experience with P2P (Procure to Pay), O2C (Order to Cash), and Scrape processes.<br />\r\n			<br style=\"font-family: Helvetica, Verdana, sans-serif;\" />\r\n			<strong style=\"font-family: Helvetica, Verdana, sans-serif;\">Key Responsibilities:</strong>\r\n			<ul>\r\n				<li>Design and develop critical dashboards for finance and inventory management.</li>\r\n				<li>Utilize Power BI to create visually appealing and user-friendly dashboards that provide actionable insights.</li>\r\n				<li>Implement best practices for dashboard design to ensure data accuracy and integrity.</li>\r\n				<li>Integrate data from various sources, including SAP 4Hana, Excel, and other databases, into Power BI.</li>\r\n				<li>Develop and manage data models, including complex data relationships and hierarchies.</li>\r\n				<li>Develop and maintain ETL (Extract, Transform, Load) processes to ensure seamless data flow from SAP to Excel and then to Power BI.</li>\r\n				<li>Ensure data is extracted accurately and transformed into a format suitable for analysis and reporting.</li>\r\n				<li>Conduct data analysis to support finance and inventory management processes.</li>\r\n				<li>Use Power BI tools to identify trends, patterns, and anomalies in data.</li>\r\n				<li>Provide insights and recommendations based on data analysis.</li>\r\n				<li>Develop and maintain dashboards and reports for P2P, O2C, and Scrape processes.</li>\r\n				<li>Ensure data related to these processes is accurately captured and reported.</li>\r\n				<li>Optimize Power BI reports and dashboards for performance and scalability.</li>\r\n				<li>Monitor performance and make adjustments as needed to improve efficiency.</li>\r\n				<li>Collaborate with finance, inventory, and IT teams to gather requirements and ensure dashboards meet business needs.</li>\r\n				<li>Communicate technical information to non-technical stakeholders in a clear and concise manner.</li>\r\n			</ul>\r\n			If you are interested in this opportunity, please share your updated CV.<br />\r\n			<br />\r\n			<span style=\"font-family: Helvetica, Verdana, sans-serif;\">Thanks,</span><br style=\"font-family: Helvetica, Verdana, sans-serif;\" />\r\n			<span style=\"font-family: Helvetica, Verdana, sans-serif;\">Sourcing Team - Unical Systems</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"6\" style=\"font-family: Helvetica,Verdana,sans-serif;font-size: 11px;color: #666666;\">\r\n			<table border=\"0\" cellpadding=\"4\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td colspan=\"2\" id=\"social\" valign=\"middle\">\r\n						<center>\r\n						<div>&nbsp;<a href=\"https://www.linkedin.com/company/unicalsystems/\" target=\"_blank\"> follow on LinkedIn</a> | <a href=\"https://www.facebook.com/unicalsystems\" target=\"_blank\">follow on Facebook</a></div>\r\n						</center>\r\n						</td>\r\n					</tr>\r\n					<!--copy right data-->\r\n					<tr>\r\n						<td valign=\"top\" width=\"350px\">\r\n						<center>\r\n						<div><em>Copyright &copy; 2024 <a href=\"www.unicalsystems.com\" target=\"_blank\">www.unicalsystems.com</a>, All rights reserved.</em></div>\r\n						</center>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</center>\r\n</div>\r\n</body>\r\n<grammarly-desktop-integration data-grammarly-shadow-root=\"true\"></grammarly-desktop-integration></html>\r\n', 0, 26, 0, 'Leads');
