(NULL, 'AWS Data Engineer', NULL, 'Immediate Requirement for Aws Data Engineer', '', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\">\r\n<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body class=\"scayt-enabled\">\r\n<div>\r\n<center>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"borderGrey\" width=\"600px\">\r\n	<tbody>\r\n		<tr style=\"height:50px;\">\r\n			<td colspan=\"6\" style=\"border-top: 1px solid rgb(221, 221, 221);\">\r\n			<p style=\"font-family: Helvetica, Verdana, sans-serif;\"><span class=\"ui-provider ed bgi bco bqq bqr bqs bqt bqu bqv bqw bqx bqy bqz bra brb brc brd bre brf brg brh bri brj brk brl brm brn bro brp brq brr brs brt bru brv\" dir=\"ltr\"><span style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, system-ui, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Web&quot;, sans-serif; font-size: 14px; white-space-collapse: preserve;\">Hello </span></span>$leads-firstname$<span class=\"ui-provider ed bgi bco bqq bqr bqs bqt bqu bqv bqw bqx bqy bqz bra brb brc brd bre brf brg brh bri brj brk brl brm brn bro brp brq brr brs brt bru brv\" dir=\"ltr\"><span style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, system-ui, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Web&quot;, sans-serif; font-size: 14px; white-space-collapse: preserve;\">,</span></span></p>\r\n\r\n			<p style=\"font-family: Helvetica, Verdana, sans-serif;\"><span class=\"ui-provider ed bgi bco bqq bqr bqs bqt bqu bqv bqw bqx bqy bqz bra brb brc brd bre brf brg brh bri brj brk brl brm brn bro brp brq brr brs brt bru brv\" dir=\"ltr\"><span style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, system-ui, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Web&quot;, sans-serif; font-size: 14px; white-space-collapse: preserve;\">&nbsp;</span></span></p>\r\n\r\n			<p s