INSERT INTO `vtiger_gptintegration_logs` (`id`, `requested_user`, `requested_on`, `provider`, `gptintegration_prompt`, `gptintegration_response`, `tokens_consumed`) VALUES
(1, '5', '2024-07-17 05:43:10', 'OpenAI', 'Send email to check Rajiv avaialabiulity for interview today evening 4 pm', 'Subject: Interview Availability Confirmation\n\nDear Rajiv,\n\nI hope this email finds you well. We are reaching out to confirm your availability for an interview today evening at 4:00 pm. \n\nYour prompt response confirming your availability would be greatly appreciated.\n\nThank you and looking forward to speaking with you.\n\nBest regards,\n\n[Your Name]\n[Your Position]\n[Company Name]', '123'),
(2, '5', '2024-07-17 11:13:07', 'OpenAI', 'write email asking to clear pending dues politely.  there are 664000 dues since last 3 montsh', 'Subject: Request for Clearing Pending Dues\n\nDear [Recipient\'s Name],\n\nI hope this email finds you well. \n\nI am writing to remind you that there are pending dues amounting to 664,000 since the last three months. We kindly request your attention to settle this outstanding amount at your earliest convenience.\n\nYour prompt payment would be greatly appreciated and will help us to maintain smooth operations. Should you require any assistance or further clarification regarding the outstanding dues, please do not hesitate to contact us.\n\nThank you for your attention to this matter. We look forward to receiving your payment soon.\n\nBest regards,\n\n[Your Name]\n[Your Position]\n[Your Contact Information]', '187'),
(3, '5', '2024-07-19 03:49:32', 'OpenAI', 'Send an email to Satya to follow up on her availaibity to attend Interview today evening at 5 PM for Powr BI Consultant', 'Subject: Interview Confirmation for Power BI Consultant Position\n\nDear Satya,\n\nI hope this email finds you well. \n\nI am writing to confirm your availability for the interview scheduled for today evening at 5:00 PM for the Power BI Consultant position. We are excited to discuss your qualifications and potential fit for the role.\n\nPlease confirm your attendance at your earliest convenience so we can finalize the interview details.\n\nThank you for your time and consideration. We look forward to meeting with you.\n\nWarm regards,\n\n[Your Name]\n[Your Title]\n[Company Name]', '170'),
(4, '5', '2024-07-19 03:50:38', 'OpenAI', 'Write email subject to check availaibity for POwer BI Interview today at 5 PM', 'Subject: Availability Confirmation for Power BI Interview Today at 5 PM\n\nDear [Recipient\'s Name],\n\nI hope this message finds you well. I am writing to confirm your availability for the Power BI interview scheduled for today at 5 PM. Please confirm at your earliest convenience if you will be able to attend the interview as scheduled.\n\nThank you for your cooperation. Looking forward to hearing from you soon.\n\nBest regards,\n\n[Your Name]', '136'),
(5, '5', '2024-07-19 03:50:52', 'OpenAI', 'Availability Confirmation for Power BI Interview Today at 5 PM', '1. \"Confirmation: Power BI Interview Today at 5 PM\"\n2. \"Please Confirm Availability for Power BI Interview\"\n3. \"Important: Availability Check for Power BI Interview\"\n4. \"Urgent: Confirmation Needed for Power BI Interview\"\n5. \"Reminder: Power BI Interview at 5 PM Today\"', '129'),
(6, '5', '2024-07-19 03:52:34', 'OpenAI', 'write response to the email', 'Subject: Response to Your Email\n\nDear [Recipient\'s Name],\n\nI hope this email finds you well. Thank you for reaching out to me. I appreciate your inquiry and am here to assist you with any information or support you may need.\n\nPlease feel free to let me know how I can be of help or if you have any further questions. I am more than happy to provide you with the necessary assistance.\n\nLooking forward to hearing from you soon.\n\nBest regards,\n\n[Your Name]', '132'),
(7, '1', '2024-07-19 15:49:02', 'OpenAI', 'rephrase the sebte', 'Could you kindly offer a straightforward and professional email text?', '47'),
(8, '1', '2024-07-19 15:49:20', 'OpenAI', 'rajkumar wants go out side', 'Subject: Request for Permission to Go Outside\n\nDear [Recipient\'s Name],\n\nI hope this message finds you well. I am writing to seek permission to go outside for a while. I assure you that I will adhere to all safety protocols and guidelines during my time outside.\n\nThank you for considering my request.\n\nSincerely,\nRajkumar', '105'),
(9, '5', '2024-07-20 08:23:04', 'OpenAI', 'Thank you for your time over the call.  Below is the Job Opening Details.  We will share the profile with client and will get back to you on Monday on next steps.\n', 'Subject: Job Opening Details\n\nDear [Recipient\'s Name],\n\nI hope this email finds you well. I wanted to follow up on our recent call and provide you with the details of the job opening we discussed.\n\n[Insert job title] position is currently available with [Company Name]. We will be sharing your profile with the client for consideration. We aim to provide you with an update on the next steps by Monday.\n\nShould you have any questions or require further information, please do not hesitate to reach out to me.\n\nThank you for your time and interest in this opportunity.\n\nWarm regards,\n\n[Your Name]\n[Your Contact Information]', '193'),
(10, '5', '2024-07-23 06:05:03', 'OpenAI', 'Your Interview is scheduled today with Regal Rexnord', '1. \"Important Reminder: Your Interview with Regal Rexnord Today\"\n2. \"Don\'t Miss Out: Interview Appointment with Regal Rexnord\"\n3. \"Action Required: Interview Scheduled Today with Regal Rexnord\"\n4. \"Exciting Opportunity: Interview with Regal Rexnord Today\"\n5. \"Urgent Update: Your Interview at Regal Rexnord\"', '146'),
(11, '1', '2024-07-25 05:58:34', 'OpenAI', 'hey raj how are you doing', 'Subject: Checking In\n\nDear [Recipient\'s Name],\n\nI hope this email finds you well. I am reaching out to check in and see how you are doing. Please let me know if there is anything I can assist you with.\n\nLooking forward to hearing from you.\n\nWarm regards,\n[Your Name]', '97'),
(12, '13', '2024-07-30 05:38:07', 'OpenAI', 'fejsdgfsjknkfsdh', 'Certainly! Here is a simple and formal mail body template that you can use:\n\nSubject: [Brief Description of the Email]\n\nDear [Recipient\'s Name],\n\nI hope this email finds you well. I am writing to [state the purpose of the email briefly].\n\n[Provide details or any necessary information here.]\n\nPlease let me know if you need any further information or assistance. Thank you for your attention to this matter.\n\nWarm regards,\n\n[Your Name]\n[Your Position]\n[Your Contact Information]', '138'),
(13, '13', '2024-07-30 07:03:02', 'OpenAI', 'Hi Iam writing just to show you how GPT works', 'Subject: Introduction to GPT\n\nDear [Recipient\'s Name],\n\nI hope this message finds you well. I am writing to provide a brief overview of how GPT (Generative Pre-trained Transformer) works. GPT is a powerful language model that uses deep learning techniques to generate human-like text based on the input it receives. By leveraging large amounts of data, GPT can generate coherent and contextually relevant responses, making it a valuable tool for various applications.\n\nIf you have any questions or would like to learn more about GPT, please feel free to reach out. Thank you for your attention.\n\nBest regards,\n\n[Your Name]', '170'),
(14, '5', '2024-08-07 10:23:32', 'OpenAI', 'Interview Slots Available on July 10th: Confirmation Required', '1. Confirm Your Interview Slot for July 10th\n2. Act Now: Secure Your Interview Time on July 10th\n3. Don\'t Miss Out: Confirm Your Interview Time for July 10th\n4. Your Presence Requested: Interview Slots Available on July 10th\n5. Last Chance to Confirm Your Interview Slot for July 10th', '138'),
(15, '5', '2024-08-07 10:24:03', 'OpenAI', 'Send email to Shiva asking his availibithy for interview tomorrow at 4 Pm', 'Subject: Interview Availability Confirmation\n\nDear Shiva,\n\nI hope this email finds you well. I am writing to confirm your availability for an interview tomorrow at 4:00 PM. Your presence and insights would be highly valuable to us.\n\nPlease confirm your attendance at the scheduled time. If there are any conflicts or concerns, kindly let me know at your earliest convenience.\n\nLooking forward to meeting you tomorrow.\n\nBest regards,\n\n[Your Name]', '136');
