0pt\"><b><span style=\"font-size:12.0pt;color:black\">From:\r\n</span></b><span style=\"font-size:12.0pt;color:black\">Shiva Kaluvakota &lt;shiva@sbts.in&gt;<br>\r\n<b>Date: </b>Tuesday, 2 April 2024 at 5:31PM<br>\r\n<b>To: </b>duecare@smartrecruitmentsolution.com &lt;duecare@smartrecruitmentsolution.com&gt;<br>\r\n<b>Subject: </b>SAP ABAP <o:p></o:p></span></p>\r\n</div>\r\n<div>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">&nbsp;</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">&nbsp;</span><o:p></o:p></p>\r\n<div id=\"mail-editor-reference-message-container\">\r\n<div>\r\n<div style=\"border:none;border-top:solid #B5C4DF 1.0pt;padding:3.0pt 0cm 0cm 0cm\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\"><b><span style=\"font-size:12.0pt;color:black\">From:\r\n</span></b><span style=\"font-size:12.0pt;color:black\">Shiva Kaluvakota &lt;shiva@sbts.in&gt;<br>\r\n<b>Date: </b>Tuesday, 2 April 2024 at 5:29PM<br>\r\n<b>To: </b>duecare@smartrecruitmentsolution.com &lt;duecare@smartrecruitmentsolution.com&gt;<br>\r\n<b>Subject: </b>Re: New Requirement </span><o:p></o:p></p>\r\n</div>\r\n<div>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">&nbsp;</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">Hello Shiva, </span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">&nbsp;</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">We are looking for a SAP ABAP Consultant for the following role:</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">&nbsp;</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">Role: FSD</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">Experience: 2-4</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">Work Location: Hyderabad</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">Shift: General (9AM 6 PM)</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">Availability: Who can join in 30 days</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">&nbsp;</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">Job Description: JD</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">&nbsp;</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">Other details: NA</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">&nbsp;</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">If you are interested send your CV to\r\n<a href=\"mailto:sourcing@unicalsystems.com\">sourcing@unicalsystems.com</a> or you can reach</span><o:p></o:p></p>\r\n<div id=\"mail-editor-reference-message-container\">\r\n<div>\r\n<div style=\"border:none;border-top:solid #B5C4DF 1.0pt;padding:3.0pt 0cm 0cm 0cm\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\"><b><span style=\"font-size:12.0pt;color:black\">From:\r\n</span></b><span style=\"font-size:12.0pt;color:black\">Shiva Kaluvakota &lt;shiva@sbts.in&gt;<br>\r\n<b>Date: </b>Tuesday, 2 April 2024 at 4:38PM<br>\r\n<b>To: </b>duecare@smartrecruitmentsolution.com &lt;duecare@smartrecruitmentsolution.com&gt;<br>\r\n<b>Subject: </b>New Requirement </span><o:p></o:p></p>\r\n</div>\r\n<div>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">&nbsp;</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">New Requirement</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:11.0pt\">&nbsp;</span><o:p></o:p></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</body>\r\n</html>\r\n<br><br>', 'utf-8', 1, 0, 0, ' <MA0P287MB0380D73A56FE39B6EE414900A03E2@MA0P287MB0380.INDP287.PROD.OUTLOOK.COM>', 1, 9, 1722318942, NULL, 'INBOX