(1, '[\"Instagram@facebook-research.facebookmail.com\"]', '[\"duecare@smartrecruitmentsolution.com\"]', '[]', '[]', '1721743940', 'Participate in a Instagram Research Study | 8/5 - 8/16', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\" \"http://www.w3.org/TR/html4/loose.dtd\">\r\n<html>\r\n  <head>\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1, maximum-scale=1, user-scalable=0\" />\r\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\r\n    <style type=\"text/css\">\r\n      ReadMsgBody{ width: 100%;}\r\n      .ExternalClass {width: 100%;}\r\n      .ExternalClass, .ExternalClass p, .ExternalClass span, .ExternalClass font, .ExternalClass td, .ExternalClass div {line-height: 100%;}\r\n      body {-webkit-text-size-adjust:100%; -ms-text-size-adjust:100%;margin:0 !important;}\r\n      p { margin: 1em 0;}\r\n      table td { border-collapse: collapse;}\r\n      img {outline:0;}\r\n      a img {border:none;}\r\n      @-ms-viewport{ width: device-width;}\r\n    </style>\r\n    <style type=\"text/css\">\r\n      @media only screen and (max-width: 480px) {\r\n        .container {width: 100% !important;}\r\n        .footer { width:auto !important; margin-left:0; }\r\n        .mobile-hidden { display:none !important; }\r\n        .logo { display:block !important; padding:0 !important; }\r\n        img { max-width:100% !important; height:auto !important; max-height:auto !important;}\r\n        .header img{max-width:100% !important;height:auto !important; max-height:auto !important;}\r\n        .photo img { width:100% !important; max-width:100% !important; height:auto !important;}\r\n        .drop { display:block !important; width: 100% !important; float:left; clear:both;}\r\n        .footerlogo { display:block !important; width: 100% !important; padding-top:15px; float:left; clear:both;}\r\n        .nav4, .nav5, .nav6 { display: none !important; }\r\n        .tableBlock {width:100% !important;}\r\n        .responsive-td {width:100% !important; display:block !important; padding:0 !important; }\r\n        .fluid, .fluid-centered {\r\n          width: 100% !important;\r\n          max-width: 100% !important;\r\n          height: auto !important;\r\n          margin-left: auto !important;\r\n          margin-right: auto !important;\r\n        }\r\n        .fluid-centered {\r\n          margin-left: auto !important;\r\n          margin-right: auto !important;\r\n        }\r\n        /* MOBILE GLOBAL STYLES - DO NOT CHANGE */\r\n        body { padding: 0px !important; font-size: 16px !important; line-height: 150% !important;}\r\n        h1 { font-size: 22px !important; line-height: normal !important;}\r\n        h2 { font-size: 20px !important; line-height: normal !important;}\r\n        h3 { font-size: 18px !important; line-height: normal !important;}\r\n        .buttonstyles {\r\n          font-family:arial,helvetica,sans-serif !important;\r\n          font-size: 16px !important;\r\n          color: #FFFFFF !important;\r\n          padding: 10px !important;\r\n        }\r\n        /* END OF MOBILE GLOBAL STYLES - DO NOT CHANGE */\r\n      }\r\n      @media only screen and (max-width: 640px) {\r\n        .container { width:100% !important; }\r\n        .mobile-hidden { display:none !important; }\r\n        .logo { display:block !important; padding:0 !important; }\r\n        .photo img { width:100% !important; height:auto !important;}\r\n        .nav5, .nav6 { display: none !important;}\r\n        .fluid, .fluid-centered {\r\n          width: 100% !important;\r\n          max-width: 100% !important;\r\n          height: auto !important;\r\n          margin-left: auto !important;\r\n          margin-right: auto !important;\r\n        }\r\n        .fluid-centered {\r\n          margin-left: auto !important;\r\n          margin-right: auto !important;\r\n        }\r\n      }\r\n    </style>\r\n    <!--[if mso]>       <style type=\"text/css\">           /* Begin Outlook Font Fix */           body, table, td {               font-family: Arial, Helvetica, sans-serif ;               font-size:16px;               color:#000000;               line-height:1;           }           /* End Outlook Font Fix */       </style>     <![endif]-->\r\n  </head>\r\n  <body bgcolor=\"#ffffff\" text=\"#000000\" style=\"background-color: #ffffff; color: #000000; padding: 0px; -webkit-text-size-adjust:none; font-size: 16px; font-family:arial,helvetica,sans-serif;\"><style type=\"text/css\">\r\ndiv.preheader \r\n{ display: none !important; } \r\n</style>\r\n<div class=\"preheader\" style=\"font-size: 1px; display: none !important;\"></div>\r\n    <div style=\"font-size:0; line-height:0;\"><img src=\"https://click.facebook-research.facebookmail.com/open.aspx?ffcb10-fe9a15757666027975-fe2b1571776c037f731776-fe32117171640474711674-ff951c72-fe3415747565057a761678-ff6015757c&d=110047&bmt=0\" width=\"1\" height=\"1\" alt=\"\"></div>\r\n    <table width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" align=\"center\">\r\n      <tr>\r\n        <td align=\"center\" valign=\"top\">\r\n          \r\n        </td>\r\n      </tr>\r\n      <tr>\r\n        <td align=\"center\">\r\n          <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" width=\"600\" class=\"container\" align=\"center\">\r\n            <tr>\r\n              <td>\r\n                <table class=\"tb_properties border_style\" style=\"background-color:#FFFFFF;\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#ffffff\" width=\"100%\">\r\n                  <tr>\r\n                    <td align=\"center\" valign=\"top\">\r\n                      <table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n                        <tr>\r\n                          <!-- added padding here -->\r\n                          <td class=\"content_padding\" style=\"\">\r\n                            <!-- end of comment -->\r\n                            <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n                              <tr> <!-- top slot -->\r\n                                <td align=\"center\" class=\"header\" valign=\"top\">\r\n                                  <table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n                                    <tbody>\r\n                                        <tr>\r\n                                          <td align=\"left\" valign=\"top\">\r\n                                            <table cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%\">\r\n                                              <tbody>\r\n                                              <tr>\r\n                                                <td class=\"responsive-td\" valign=\"top\" style=\"width: 100%;\">\r\n                                                  <table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" role=\"presentation\" style=\"min-width: 100%; \" class=\"stylingblock-content-wrapper\"><tr><td class=\"stylingblock-content-wrapper camarker-inner\">\r\n\r\n</td></tr></table>\r\n<table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" role=\"presentation\" class=\"stylingblock-content-wrapper\" style=\"min-width: 100%; \"><tr><td class=\"stylingblock-content-margin-cell\" style=\"padding: 20px; \"><table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" role=\"presentation\" style=\"background-color: transparent; min-width: 100%; \" class=\"stylingblock-content-wrapper\"><tr><td style=\"padding: 0px 5px; \" class=\"stylingblock-content-wrapper camarker-inner\"><div style=\"line-height: 115%;\">\r\n	<span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:13px;\">Hello Unical Systems Private Limited,</span></span></div><div style=\"line-height: 115%;\">\r\n	<div style=\"line-height: 115%;\">\r\n		<br>\r\n		<span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:13px;\">Instagram is holding a series of <b>60 minute</b> research sessions on <b>August 5th - August 16th</b>. We want to learn more about how people use Instagram, and how we can make it a better experience. You\'ll receive a 12553 INR Reward provided by the vendor.&nbsp;The research will be conducted by&nbsp;Escalent on Instagram\'s behalf.<br>\r\n		<br>\r\n		If you are interested in participating, please <b style=\"font-family: Arial, Helvetica, sans-serif; font-size: 14px;\"><a   data-linkto=\"other\" href=\"https://click.facebook-research.facebookmail.com/?qs=5e9ba35250a7c7cba621860283673828b1fbae2caa93cf4ef79ab76b21e96893fb644547ae67f3fac1ebab225bb4b9642b1d6f971cb4b55618386ca48455b7bf\" style=\"color:#2980b9;text-decoration:underline;\" title=\"click here\">click here</a></b> and complete the form and you will receive a follow-up call or email with more details from our partner research company, <b>Escalent</b>. Please note that by completing this form, Instagram may provide your contact information and answers to our partner research company, <b>Escalent</b>.<br>\r\n		<br>\r\n		If you consent to take part in this survey, Meta will use the information gathered from the survey, together with other information about how you use Meta Products, for research purposes, including to determine whether you are eligible to take part in subsequent research sessions.</span></span><br>\r\n		<br>\r\n		<span style=\"font-size:13px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">If you are not available/interested at this time, please <b><a   data-linkto=\"https://\" href=\"https://click.facebook-research.facebookmail.com/?qs=5e9ba35250a7c7cb6b1f512607cdb7973c53eb66c6321568eb47e6d03bc0bf076f90498779124101eb278daec4c509fdad0a23cb0432ea3657c248f0395eb412\" style=\"text-decoration:underline;\" title=\"opt-in\">click here</a></b> to let us know you&rsquo;d still like to be considered for future paid Meta Research opportunities.</span></span><br>\r\n		<span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:13px;\">&nbsp;</span></span></div><div style=\"line-height: 115%;\">\r\n		<span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:13px;\">You can withdraw your consent at any time by contacting <a alias=\"uxpmcontact@meta.com\" conversion=\"false\" data-linkto=\"mailto:\" href=\"mailto:uxpmcontact@meta.com?subject=\" style=\"color:#2980b9;text-decoration:underline;\" title=\"uxpmcontact@meta.com\">uxpmcontact@meta.com</a> as detailed below and in your invitation email. This survey is part of Meta&rsquo;s efforts to improve our products, in accordance with our Data Policy.<br>\r\n		<br>\r\n		If you have any questions about this survey or how you can exercise your data protection rights (which may include the right of access, rectification, portability, erasure, and consent withdrawal), please contact: <a alias=\"uxpmcontact@meta.com\" conversion=\"false\" data-linkto=\"mailto:\" href=\"mailto:uxpmcontact@meta.com?subject=\" style=\"color:#2980b9;text-decoration:underline;\" title=\"uxpmcontact@meta.com\">uxpmcontact@meta.com</a>.<br>\r\n		<br>\r\n		Expressing interest does not guarantee you will be selected to participate.<br>\r\n		<br>\r\n		Thank You,<br>\r\n		Diamond |&nbsp;Instagram User Experience Research Team</span></span></div><div style=\"line-height: 115%;\">\r\n		<span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:13px;\">&nbsp;</span></span></div></div></td></tr></table></td></tr></table>\r\n<table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" role=\"presentation\" style=\"min-width: 100%; \" class=\"stylingblock-content-wrapper\"><tr><td class=\"stylingblock-content-wrapper camarker-inner\"><table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" role=\"presentation\"><tr><td align=\"center\"><img data-assetid=\"48002\" src=\"https://image.research.mail-instagram.com/lib/fe32117171640474751678/m/1/d24bf236-80e4-40fd-be33-dedb074e6b6d.png\" alt=\"\" height=\"10